import React from 'react';
import Card from 'react-bootstrap/Card'

function SymbolCard() {
  return (
    <div className="card">
      <Card style={{ width: '18rem', flexDirection: 'row' }}>
        <Card.Body style={{width: '20%', backgroundColor: "red"}}>
        </Card.Body>
        <Card.Body style={{}}>
          <div></div>
        </Card.Body>
      </Card>
    </div>
  );
}

export default SymbolCard;
